import { Button } from '@chakra-ui/button'
import { SearchIcon } from '@chakra-ui/icons'
import { Text } from '@chakra-ui/layout';
import React, { memo, VFC } from 'react'

type Props = {
    onClickAnimeSearch: () => void
}

const PraimaryButton: VFC<Props> = (props) => {
    const { onClickAnimeSearch } = props
    return (
        <Button leftIcon={<SearchIcon color="white" />} iconSpacing='5px' colorScheme="pink" variant="solid" _hover={{opacity: 0.7}}>
            <Text as='p' lineHeight='40px'>
                アニメを検索
            </Text>
        </Button>
    )
}

export default PraimaryButton
